import React from 'react';

const App = () => {

  const recherche = () => {

    fetch('http://localhost:2000/graphql' , {
      method: 'GET',
      body: null,
      headers: {
        'Content-Type': 'application/json'
      }
    }).then(res => {
      return console.log(res.json)
    }).then(err => {
      if(err)
        return console.log(err);
    })

    return console.log('cool recherche');
  }

  return(

    <div>
        <h2>Salut tous le monde</h2>
        { recherche() }
    </div>
  )
}

export default App;
